		"full_text": "이달의 소녀가 색이 없다는 이야기가 아님. 솔로앨범과 유닛앨범에서 보여주던 모습을 포함해 풀어놓은 세계관이나 팬들로부터 확장된 세계관이라는 니즈를 팬들에게는 채워줘야 하고 앞선 트윗에서 말한 것처럼 대중에게 어필도 필요했는데 둘 다 부족하지 않았나 싶음.",
