		"text": "데이터가 적당히 쌓이면 다음처럼 관심 순으로 정렬 해 줍니다.\n(1) 요일 목록 내에서 정렬 해 줍니다.\n(2) 전체 연재 목록도 정렬 해 줍니다.\n(3) 본 작품은 회색으로 보여 줍니다.\n초기에는 플러그인이 분석할 데이터가 없어서 대부분이 회색으로 보이지만 평소대로 쓰시면 자리를 잡을 겁니다. https://t.co/4wkMmqbtJw"
